    "headlineNews": "Daniel Jones completed 23-of-38 passes for 167 yards, one touchdown, and two interceptions in the Giants' 30-10, Week 11 loss to the Bucs Monday night.\n",
    "report": "",
    "analysis": "Outside of a disastrous Week 6 against the Rams, this was easily Jones' worst game of the season, and it came on national television in ugly fashion. Jones and the Giants marched down the field on the opening possession only to stall in the red zone before settling for a field goal. It was all bad after that, as Jones' touchdown was a gift via a Mike Evans drop that goes on the books as a Tom Brady interception. It was returned inside the 10-yard line, and Jones tossed a two-yard score to LT Andrew Thomas on a trick play to finish it off. Jones' two interceptions were truly idiotic throws. One was right to NT Steve McLendon with no Giants player in the vicinity, and the second a forced pass to Darius Slayton. This was Jones' second multi-INT game of the year. He'll try to forget it and move on to a Week 12 home game against the Eagles as a middling QB2.\n",
