    "analysis": "Having undergone multiple surgeries on his throwing shoulder in recent years, Newton's ability to make downfield throws -- a former strength of his -- was in question when Carolina signed him as their starter this month. Newton completed 21 of his 26 attempts for 189 yards (7.26 yards per attempt) in his Week 11 start against Washington, but completed just one pass of more than 19 yards. Rhule said the lack of downfield passing was due to offensive coordinator Joe Brady's game plan. \u201cTypically, since we\u2019ve been here, Joe\u2019s been more of an underneath, passing game guy,\" Rhule said. \"We have to continue to push the deep passing game. ... So I wouldn\u2019t put that on (Newton). I know that\u2019s kind of a narrative right now.\" More down-the-field attempts would give D.J. Moore and Robby Anderson some sort of fantasy ceiling in a Cam-led offense. For now, only Moore -- who had 50 yards and a touchdown on five catches against Washington -- has a decent statistical floor.\u00a0\n",
