    "headlineNews": "Miles Sanders rushed 16 times for 94 yards in the Eagles' Week 11 win over the Saints.\n",
    "report": "",
    "analysis": "Sanders also lost a fumble at the Eagles' own four-yard line early in the second quarter, setting up a Saints touchdown. Amazingly, Sanders did it again from the Eagles' own four near the first half two-minute warning, but dubiously, his forward progress was ruled stopped. Before fumbling on that play, he mishandled the snap. Jordan Howard finished the half and entered the break out-carrying Sanders 9-8. Howard then went down early in the third quarter with a knee injury and did not return. It's fair to wonder how much work Sanders would have ended up with without Howard's injury, but he took the rock eight times in the second half. Boston Scott mixed in for only eight touches for 18 yards. Sanders ended up with three carries of 10-plus yards, so he did put some good things on film against a tough run defense. Jalen Hurts, however, vultured all three of the Eagles' rushing scores. Sanders' final Week 12 ranking against the Giants is going to depend on Howard's health, but he will at least be a FLEX.\u00a0 \u00a0\n",
